import React, { useState } from 'react';
import { useNavigate } from 'react-router-dom';
import { 
  Home, 
  Calendar, 
  Ticket, 
  User, 
  Bell, 
  Search, 
  Clock, 
  MapPin,
  ArrowLeft,
  X 
} from 'lucide-react';

const Dashboard = ({ events, searchTerm, setSearchTerm, regCount }) => {
  const navigate = useNavigate();
  const [isSearchActive, setIsSearchActive] = useState(false);

  return (
    <div style={styles.container}>
      {/* Dynamic Header: Switches between Logo/Icons and Search Bar */}
      <header style={styles.header}>
        {!isSearchActive ? (
          /* Normal Header View */
          <>
            <div style={styles.logoGroup}>
              <div style={styles.logoCircle}>ES</div>
              <span style={styles.brandName}>EventSphere</span>
            </div>
            <div style={styles.headerIcons}>
              <Search 
                size={22} 
                style={styles.iconCursor} 
                onClick={() => setIsSearchActive(true)} 
              />
              <Bell 
                size={24} 
                style={styles.iconCursor} 
                onClick={() => navigate('/notifications')} 
              />
            </div>
          </>
        ) : (
          /* YouTube Style Expanded Search View */
          <div style={styles.searchHeaderFull}>
            <ArrowLeft 
              size={24} 
              style={styles.iconCursor} 
              onClick={() => {
                setIsSearchActive(false);
                setSearchTerm("");
              }} 
            />
            <div style={styles.searchInputWrapper}>
              <input 
                autoFocus
                type="text" 
                placeholder="Search events..." 
                style={styles.fullInput} 
                value={searchTerm}
                onChange={(e) => setSearchTerm(e.target.value)}
              />
              {searchTerm && (
                <X 
                  size={20} 
                  style={styles.clearIcon} 
                  onClick={() => setSearchTerm("")} 
                />
              )}
            </div>
          </div>
        )}
      </header>

      {/* Main Content Area */}
      <div style={{ marginTop: '10px' }}>
        <h1 style={styles.greeting}>Hi Student ðŸ‘‹</h1>
        <p style={styles.subGreeting}>Explore college events</p>
      </div>

      {/* Stats Grid */}
      <div style={styles.statsGrid}>
        <div style={styles.statCard}><span style={styles.statLabel}>Upcoming</span><div style={styles.statValue}>3</div></div>
        <div style={{...styles.statCard, cursor: 'pointer'}} onClick={() => navigate('/my-events')}>
          <span style={styles.statLabel}>Registered</span><div style={styles.statValue}>{regCount}</div>
        </div>
        <div style={styles.statCard}><span style={styles.statLabel}>My Tickets</span><div style={styles.statValue}>2</div></div>
        <div style={styles.statCard}><span style={styles.statLabel}>Announcements</span><div style={styles.statValue}>4</div></div>
      </div>

      <div style={styles.sectionHeader}>
        <h3 style={styles.sectionTitle}>Upcoming Events</h3>
        <span style={styles.seeAll} onClick={() => navigate('/events')}>See all</span>
      </div>

      {/* Event Cards with Clock and Location Icons */}
      <div style={styles.horizontalScroll}>
        {events.length > 0 ? (
          events.map(event => (
            <div key={event.id} style={styles.eventCard}>
              <div style={{ ...styles.banner, backgroundImage: `url(${event.image})` }}>
                <div style={styles.bannerOverlay}>TECHNOVATE 2026</div>
              </div>
              <div style={styles.cardInfo}>
                <h4 style={styles.eventTitle}>{event.title}</h4>
                <div style={styles.iconRow}><Clock size={12} style={styles.smallIcon} /><span>{event.date}</span></div>
                <div style={styles.iconRow}><MapPin size={12} style={styles.smallIcon} /><span>Main Auditorium</span></div>
                <button style={styles.regBtn} onClick={() => navigate('/events')}>Register</button>
              </div>
            </div>
          ))
        ) : (
          <div style={styles.noResults}>No events matching "{searchTerm}"</div>
        )}
      </div>

      {/* Bottom Nav */}
      <nav style={styles.bottomNav}>
        <div style={{ ...styles.navItem, color: '#2563eb' }} onClick={() => navigate('/')}><Home size={22} /><span>Home</span></div>
        <div style={styles.navItem} onClick={() => navigate('/events')}><Calendar size={22} /><span>Events</span></div>
        <div style={styles.navItem} onClick={() => navigate('/my-events')}><Ticket size={22} /><span>My Events</span></div>
